import React, {Component} from 'react';
import Search from "./compontens/Search";
import List from "./compontens/List";
import './App.css'
class App extends Component {
    state={users:[]}//初始化数组users
    save_users=(users)=>{
        this.setState({users:users})
    }

    render() {
        return (
            <div className="container">
                <Search/>
                <List/>
            </div>
        );
    }
}

export default App;
